"""
Example 1:

Input: "abcabcbb"
Output: 3
Explanation: The answer is "abc", which the length is 3.
Example 2:

Input: "bbbbb"
Output: 1
Explanation: The answer is "b", with the length of 1.
Example 3:

Input: "pwwkew"
Output: 3
Explanation: The answer is "wke", with the length of 3.
             Note that the answer must be a substring, "pwke" is a subsequence and not a substring.
"""


class Solution:
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        _s = list(s)
        _len = len(_s)
        tbl = []
        _mlen = 0
        start = end = 0

        for i in range(_len):
            if _s[i] in tbl:
                _tlen = len(tbl)
                for j in range(_tlen):
                    if tbl[_tlen - j - 1] == _s[i]:
                        start = _tlen - j
                        tbl = tbl[start:]
                        tbl.append(_s[i])
                        break
            else:
                tbl.append(_s[i])

            _mlen = max(len(tbl), _mlen)

        return _mlen


